Это период в истории русской культуры, хронологически связываемый с началом XX века, совпавший с эпохой модернизма.
Название «Серебряный век» дано по аналогии с «Золотым веком» (первая треть XIX века). На авторство термина претендовали философ Николай Бердяев, писатели Николай Оцуп, Сергей Маковский. 
«Серебряный век» протекал 
с 1880 до 1920 годов.
Городские и сельские начальные школы постепенно вытесняли церковно-приходское образование;
росло число гимназий и реальных училищ;
возросло количество средних специальных учебных заведений;
к 1914 году действовало более 100 высших учебных заведений.
